-- 1. Connect to your SQL Server instance and the master database


-- 2. Run the following code to create an empty database called SAMPLEDB
USE master;

-- Drop database
IF DB_ID(N'SAMPLEDB') IS NOT NULL DROP DATABASE SAMPLEDB;


-- If database could not be created due to open connections then abort
IF @@ERROR = 3702 
   RAISERROR(N'Database cannot be dropped because there are still open connections.', 127, 127) WITH NOWAIT, LOG;

-- Create database
CREATE DATABASE SAMPLEDB;
GO

USE SAMPLEDB;
GO


---------------------------------------------------------------------
-- Create Schemas
---------------------------------------------------------------------

CREATE SCHEMA hcm AUTHORIZATION dbo;
GO
CREATE SCHEMA oes AUTHORIZATION dbo;
GO
CREATE SCHEMA bird AUTHORIZATION dbo;
GO

---------------------------------------------------------------------
-- Create Tables
---------------------------------------------------------------------

--create table hcm.countries
CREATE TABLE hcm.countries
(
	country_id INT NOT NULL IDENTITY,
	country_name VARCHAR(50),
	CONSTRAINT pk_countries PRIMARY KEY (country_id),
	CONSTRAINT uk_countries_country_name UNIQUE (country_name)
);

--create table hcm.locations
CREATE TABLE hcm.locations 
(
	location_id         INT NOT NULL IDENTITY,
	street_address      VARCHAR(100) NOT NULL,
	city                VARCHAR(50) NOT NULL,
	state_province      VARCHAR(50),
	postal_code         VARCHAR(10),
	country_id          INT NOT NULL,
	CONSTRAINT pk_locations PRIMARY KEY (location_id),
	CONSTRAINT fk_locations_countries FOREIGN KEY (country_id)
		REFERENCES hcm.countries(country_id)
);


--create table hcm.departments
CREATE TABLE hcm.departments 
(
	department_id INT NOT NULL IDENTITY(10, 10),
	department_name VARCHAR(50) NOT NULL,
	location_id INT NOT NULL,
	CONSTRAINT pk_departments PRIMARY KEY (department_id),
	CONSTRAINT fk_departments_locations FOREIGN KEY (location_id)
		REFERENCES hcm.locations(location_id)
);


--create table hcm.jobs
CREATE TABLE hcm.jobs
(
	job_id INT NOT NULL IDENTITY,
	job_title VARCHAR(40) NOT NULL,
	min_salary NUMERIC(12,2),
	max_salary NUMERIC(12,2),
	CONSTRAINT pk_jobs PRIMARY KEY (job_id)
);


-- Create table hcm.employees
CREATE TABLE hcm.employees
(
  employee_id INT NOT NULL IDENTITY,
  first_name VARCHAR(50) NOT NULL,
  middle_name VARCHAR(50),
  last_name VARCHAR(50) NOT NULL,
  job_id INT NOT NULL,
  salary NUMERIC(12,2),
  birth_date DATE NOT NULL,
  hire_date DATE NOT NULL,
  department_id INT,
  manager_id INT,
  phone VARCHAR(26) NOT NULL,
  street_address VARCHAR(100) NOT NULL,
  city VARCHAR(50) NOT NULL,
  state_province VARCHAR(50),
  postal_code VARCHAR(10),
  country_id INT NOT NULL,
  CONSTRAINT pk_employees PRIMARY KEY(employee_id),
  CONSTRAINT fk_employees_manager_id FOREIGN KEY(manager_id)
    REFERENCES hcm.employees(employee_id),
  CONSTRAINT fk_employees_jobs FOREIGN KEY (job_id)
    REFERENCES hcm.jobs (job_id),
  CONSTRAINT fk_employees_departments FOREIGN KEY (department_id) 
	REFERENCES hcm.departments (department_id),
  CONSTRAINT fk_employees_countries FOREIGN KEY (country_id)
    REFERENCES hcm.countries (country_id),
  CONSTRAINT chk_employees_birth_date CHECK (birth_date < hire_date)
  --,CONSTRAINT chk_employees_salary CHECK (salary > 0)
);

CREATE INDEX ix_employees_lastname ON hcm.employees(last_name);
CREATE INDEX ix_employees_country_id ON hcm.employees(country_id);
CREATE INDEX ix_employees_manager_id ON hcm.employees(manager_id);

	
	
-- Create table oes.Customers
CREATE TABLE oes.customers
(
  customer_id INT NOT NULL IDENTITY,
  first_name VARCHAR(50) NOT NULL,
  last_name VARCHAR(50) NOT NULL,  
  email VARCHAR(320) NOT NULL,
  phone VARCHAR(26) NOT NULL,
  street_address VARCHAR(100) NOT NULL,
  city VARCHAR(50) NOT NULL,
  state_province VARCHAR(50),
  postal_code VARCHAR(10),
  loyalty_card_issued BIT NOT NULL CONSTRAINT dft_loyalty_card_issued DEFAULT(0),
  country_id INT NOT NULL,
  CONSTRAINT pk_customers_customer_id PRIMARY KEY(customer_id),
  CONSTRAINT fk_customers_countries FOREIGN KEY (country_id)
	REFERENCES hcm.countries (country_id)
);

CREATE INDEX ix_customers_city ON oes.customers(city);
CREATE INDEX ix_customers_state_province ON oes.customers(state_province);
CREATE INDEX ix_customers_country_id ON oes.customers(country_id);


-- Create table oes.Shippers
CREATE TABLE oes.shippers
(
  shipper_id INT NOT NULL IDENTITY,
  company_name VARCHAR(40) NOT NULL,
  email VARCHAR(320) NOT NULL,
  phone VARCHAR(24) NOT NULL,
  CONSTRAINT pk_shippers_shipper_id PRIMARY KEY(shipper_id)
);


--create table oes.warehouses 
CREATE TABLE oes.warehouses 
(
	warehouse_id INT NOT NULL IDENTITY,
	warehouse_name VARCHAR(50),
	location_id INT,
	CONSTRAINT pk_warehouses_warehouse_id PRIMARY KEY (warehouse_id),
	CONSTRAINT fk_warehouses_locations FOREIGN KEY (location_id)
	 REFERENCES hcm.locations (location_id)
);



-- Create table oes.product_categories
CREATE TABLE oes.product_categories
(
  category_id INT NOT NULL IDENTITY,
  category_name VARCHAR(40) NOT NULL,
  category_description  VARCHAR(300) NOT NULL,
  CONSTRAINT pk_product_categories_cat_id PRIMARY KEY(category_id),
  CONSTRAINT uk_product_categories_cat_name UNIQUE (category_name)
);

CREATE INDEX ix_category_name ON oes.product_categories(category_name);


-- Create table oes.products
CREATE TABLE oes.products 
(
  product_id INT NOT NULL IDENTITY,
  product_name VARCHAR(100) NOT NULL,
  category_id INT NOT NULL,
  list_price NUMERIC(19,4) NOT NULL CONSTRAINT dft_products_list_price DEFAULT(0),
  discontinued BIT NOT NULL CONSTRAINT dft_products_discontinued DEFAULT(0),
  CONSTRAINT pk_products_product_id PRIMARY KEY (product_id),
  CONSTRAINT fk_products_product_categories FOREIGN KEY (category_id)
    REFERENCES oes.product_categories (category_id),
  CONSTRAINT chk_products_list_price CHECK(list_price >= 0)
);

CREATE INDEX ix_products_category_id ON oes.products(category_id);



--Create table oes.inventories
CREATE TABLE oes.inventories
(
	product_id INT NOT NULL,
	warehouse_id INT NOT NULL,
	quantity_on_hand INT NOT NULL,
	CONSTRAINT pk_inventories PRIMARY KEY (product_id, warehouse_id),
	CONSTRAINT fk_inventories_products FOREIGN KEY (product_id)
	  REFERENCES oes.products (product_id),
	CONSTRAINT fk_inventories_warehouses FOREIGN KEY (warehouse_id)
	  REFERENCES oes.warehouses (warehouse_id)
);

CREATE INDEX ix_inventories_product_id ON oes.inventories(product_id);
CREATE INDEX ix_inventories_warehouse_id ON oes.inventories(warehouse_id);



-- Create table oes.orders
CREATE TABLE oes.orders
(
  order_id INT NOT NULL IDENTITY,
  customer_id INT NOT NULL,
  employee_id INT,
  order_date DATE NOT NULL,
  shipped_date DATE NULL,
  shipper_id INT NOT NULL,
  freight_cost NUMERIC(19,4) NOT NULL CONSTRAINT dft_orders_freight_cost DEFAULT(0),
  CONSTRAINT pk_orders_order_id PRIMARY KEY (order_id),
  CONSTRAINT fk_orders_customer_id FOREIGN KEY (customer_id)
    REFERENCES oes.customers (customer_id),
  CONSTRAINT fk_orders_employees FOREIGN KEY (employee_id)
    REFERENCES hcm.employees (employee_id),
  CONSTRAINT fk_orders_shippers FOREIGN KEY (shipper_id)
    REFERENCES oes.shippers (shipper_id)
);

CREATE INDEX ix_orders_customer_id ON oes.orders(customer_id);
CREATE INDEX ix_orders_employee_id ON oes.orders(employee_id);
CREATE INDEX ix_orders_shipper_id ON oes.orders(shipper_id);
CREATE INDEX ix_orders_order_date ON oes.orders(order_date);



-- Create table oes.order_items
CREATE TABLE oes.order_items
(
  order_id INT NOT NULL,
  product_id INT NOT NULL,
  unit_price NUMERIC(19,4) NOT NULL CONSTRAINT dft_order_items_unit_price DEFAULT(0),
  quantity INT NOT NULL CONSTRAINT dft_order_items_quantity DEFAULT(1),
  discount  NUMERIC(4,3) NOT NULL CONSTRAINT dft_order_items_discount DEFAULT(0),
  CONSTRAINT pk_order_items PRIMARY KEY (order_id, product_id),
  CONSTRAINT fk_order_items_orders FOREIGN KEY(order_id)
    REFERENCES oes.orders(order_id),
  CONSTRAINT fk_order_items_products FOREIGN KEY(product_id)
    REFERENCES oes.products(product_id),
  CONSTRAINT chk_order_items_discount  CHECK (discount BETWEEN 0 AND 1),
  CONSTRAINT chk_order_items_quantity  CHECK (quantity > 0),
  CONSTRAINT chk_unit_price CHECK (unit_price >= 0)
);

CREATE INDEX ix_order_items_order_id ON oes.order_items(order_id);
CREATE INDEX ix_order_items_product_id ON oes.order_items(product_id);


-- Create table bird.arizona_sightings
CREATE TABLE bird.arizona_sightings
(
	sighting_id INT NOT NULL IDENTITY,
	common_name VARCHAR(60),
	scientific_name VARCHAR(60),
	sighting_location VARCHAR(50),
	sighting_date DATE,
	CONSTRAINT pk_arizona_sightings PRIMARY KEY (sighting_id)
);

-- Create table bird.california_sightings
CREATE TABLE bird.california_sightings
(
	sighting_id INT NOT NULL IDENTITY,
	common_name VARCHAR(60),
	scientific_name VARCHAR(60),
	location_of_sighting VARCHAR(50),
	sighting_date DATE,
	CONSTRAINT pk_california_sightings PRIMARY KEY (sighting_id)
);

-- Create table bird.florida_sightings
CREATE TABLE bird.florida_sightings
(
	observation_id INT NOT NULL IDENTITY,
	scientific_name VARCHAR(50),
	locality VARCHAR(50),
	sighting_datetime DATETIME2,
	CONSTRAINT pk_florida_sightings PRIMARY KEY (observation_id)
);


-- Create table bird.antarctic_species 
CREATE TABLE bird.antarctic_species 
(
	species_id INT NOT NULL IDENTITY,
	scientific_name VARCHAR(50),
	common_name VARCHAR(50),
	CONSTRAINT pk_antarctic_species PRIMARY KEY (species_id)
);

CREATE UNIQUE INDEX UK_ix_antarctic_species ON bird.antarctic_species (scientific_name);


-- Create table bird.antarctic_populations
CREATE TABLE bird.antarctic_populations 
(
	species_id INT NOT NULL,
	locality VARCHAR(50) NOT NULL,
	population_count INT,
	date_of_count DATE NOT NULL,
	CONSTRAINT pk_antarctic_populations PRIMARY KEY (species_id, locality, date_of_count),
	CONSTRAINT fk_antarctic_populations_species FOREIGN KEY (species_id)
		REFERENCES bird.antarctic_species (species_id)
);

CREATE INDEX ix_antarctic_popdate_of_count ON bird.antarctic_populations (date_of_count);



